import React, { useState } from 'react';
import './App.css';
import Login from './components/Login';
import Post from './components/Post';
import Wall from './components/Wall'

function App() {
  const [token, setToken] = useState('');

  const userLogin = (tok) => {
    setToken(tok);
  }

  return (
    <div className = 'App'>
      <Login userLogin={userLogin}/>
      <Post token={token}/>
      <Wall/>
    </div>
  );
}

export default App;
